Let's take a look at something more complicated than Escrow. How about the Serum dex itself! To begin, let's examine the project structure. It looks like a monorepo: both the on-chain program and the app live in the same codebase. Ok, now let's look for the entrypoint to the on-chain program. Remember that entrypoint! macro mentioned earlier? It's being called in dex/src/lib.rs: #[cfg(all(feature = "program", not(feature = "no-entrypoint")))]
use solana_program::entrypoint;
#[cfg(feature = "program")]
use solana_program::{account_info::AccountInfo, entrypoint::ProgramResult, pubkey::Pubkey}; #[cfg(feature = "program")]
#[cfg(not(feature = "no-entrypoint"))]
entrypoint!(process_instruction);
#[cfg(feature = "program")]
fn process_instruction( program_id: &Pubkey, accounts: &[AccountInfo], instruction_data: &[u8],
) -> ProgramResult { Ok(state::State::process( program_id, accounts, instruction_data, )?)
} Simple enough. Continuing to follow the white rabbit into the process method of state.rs: #[cfg_attr(not(feature = "program"), allow(unused))]
impl State { #[cfg(feature = "program")] pub fn process(program_id: &Pubkey, accounts: &[AccountInfo], input: &[u8]) -> DexResult { let instruction = MarketInstruction::unpack(input).ok_or(ProgramError::InvalidArgument)?; match instruction { MarketInstruction::InitializeMarket(ref inner) => Self::process_initialize_market( account_parser::InitializeMarketArgs::new(program_id, inner, accounts)?, )?, MarketInstruction::NewOrder(_inner) => { unimplemented!() } MarketInstruction::NewOrderV2(_inner) => { unimplemented!() } MarketInstruction::NewOrderV3(ref inner) => { account_parser::NewOrderV3Args::with_parsed_args( program_id, inner, accounts, Self::process_new_order_v3, )? } ... Interesting! So it looks like they deserialize the instructions then pattern match to figure out what the client wants to do. As you might expect, these are standard instructions you'd run on an order book.
